import React from 'react';
import { Grid, Typography } from '@mui/material';

const SendTokens = () => {
  return (
    <Grid container direction="column" alignItems="flex-start">
      <Grid
        item
        container
        alignItems="center"
        style={{ minHeight: '60vh' }}
      >
            <Grid item>
               <Typography>
                   Send Tokens
               </Typography>
            </Grid>

      </Grid>
    </Grid>
  );
};

export default SendTokens;
